var images=['data:image/bmp;base64,'];function LoadImagesAndRender(){var loadedImages=0;for(var i=0;i<images.length;i++){var source=images[i];images[i]=new Image();images[i].src=source;images[i].onload=function(){loadedImages++;if (loadedImages==images.length){Render();}};}}function Render(){let a=document.getElementById('24560c60339c4ca390a837c9064149c5');let b=a.getContext('2d');a.width=432;a.height=1600;b.drawImage(images[0],0,0,432,1600,0,0,432,1600);}window.addEventListener('onload',LoadImagesAndRender());
